window.bookSummaryJSON = "<p>I'm going to kill my hunter. He's turned me into something that shouldn't be magically possible, so now I have this to deal with on top of everything else. </p> <p>Well...I might as well make lemonade out of these freakin' lemons. Yep, that's right Mr. Broody Hunter, I'm going to take these newborn powers you thrust upon me and stop sitting on the sidelines. I'm done taking orders from others and you, and I'm done waiting for the supernatural forces to fix my problems. </p> <p>I'm going to solve the mystery that's been weaving itself around me for far too long, especially when it becomes crystal clear that the key my nemesis has been seeking has been buried inside me all along.</p>"; 
